import React from "react";
import "./App.css";


function AthleteList ({ athletes, onAthleteClick, setSelectedAthlete }) {

    function handleClick(e) {
        onAthleteClick(e.target.id)
    }

    function handleAllClick(e){
        setSelectedAthlete("All")
    }

    const alphaOrder = athletes.sort((a, b) => a.name.localeCompare(b.name) )

    return (
        <div id="athlete_list">
            <p>Name(id#)</p>
            {alphaOrder.map((athlete) => <p className="athlete_name" key={athlete.id} id={athlete.id} onClick={handleClick}>{athlete.name} ({athlete.id})</p>)}
            <p onClick={handleAllClick} value="All">Show All</p>
        </div>
    )
}

export default AthleteList
